import React from 'react'
import Axios from 'axios'

async function getApi(){
    let data
    let html = ""
    let para = ""
    try {
        const response = await Axios.get("/test");
        data = response.data.rows
        console.log(response.data.rows)
    } catch (err){
        console.log(err)
    }
    data.forEach(element => {
        para = ""
        element.forEach(col => {
            para += (col)+", "
        })
        console.log(para)
        html += <p>para</p>
        console.log(html)
    });
    return html

}
function Databases(){
    return(
        <div>
            <h1>Databases</h1>
            <div>
                {getApi()}
            </div>
        </div>
    )
}

export default Databases;
